//Helper waktu, delay
const waktu = () => {
  const now = new Date();
  const hh = String(now.getHours()).padStart(2, '0');
  const mm = String(now.getMinutes()).padStart(2, '0');
  return `[ ${hh}:${mm} ]`;
};
const delay = ms => new Promise(resolve => setTimeout(resolve, ms));

