// -- Helper random digit unik -- //
const rand = (totalDigits = 3) => {
  const now = new Date();
  const random3 = Math.floor(Math.random() * 900) + 100; // 100999
  const timestamp = now.getTime().toString(); // milidetik (biasanya 13 digit)
  let combined = `${random3}${timestamp}`;
  // Jika hasil terlalu panjang  potong
  if (combined.length > totalDigits) {
    combined = combined.slice(-totalDigits);
  }
  // Jika hasil terlalu pendek  tambah digit acak sampai pas
  while (combined.length < totalDigits) {
    combined += Math.floor(Math.random() * 10);
  }
  return combined;
};

// Helper get code otp 2factor //
const get2faCode = async (text2factor, { retries = 2, delayMs = 500 } = {}) => {
  const endpoint = (id) => `https://2fa.fb.rip/api/otp/${id}`;
  // helper sleep
  const sleep = (ms) => new Promise(res => setTimeout(res, ms));
  for (let attempt = 0; attempt <= retries; attempt++) {
    try {
      const res = await axios.get(endpoint(text2factor));
      const data = res?.data?.data;
      if (!data) {
        // Jika respons tidak berisi data, lempar agar bisa retry atau ditangani oleh caller
        throw new Error('Response tidak berisi data OTP');
      }
      // Jika timeRemaining < 1, ambil lagi (fresh)
      if (typeof data.timeRemaining === 'number' && data.timeRemaining < 1) {
        // ask new one
        const resNew = await axios.get(endpoint(text2factor));
        const newData = resNew?.data?.data;
        if (!newData) throw new Error('Gagal mendapatkan OTP baru');
        return newData.otp;
      }
      // Kalau masih valid pakai yang pertama
      return data.otp;
    } catch (err) {
      // jika masih ada kesempatan retry, tunggu lalu coba lagi
      if (attempt < retries) {
        await sleep(delayMs * (attempt + 1)); // sedikit backoff linear
        continue;
      }
      // kalau sudah habis retry, lempar error
      throw err;
    }
  }
};

