(async () => {
  // --- Input MAX_PARALLEL ---
  const askQuestion = (question) => {
    const rl = readline.createInterface({
      input: process.stdin,
      output: process.stdout
    });
    return new Promise(resolve => {
      rl.question(question, answer => {
        rl.close();
        resolve(answer);
      });
    });
  };

  const MAX_PARALLEL = parseInt(await askQuestion('Max browser? '), 10);
  const MAX_CREATE = parseInt(await askQuestion('Ngekrit peng piro? '), 10);

  if (isNaN(MAX_PARALLEL) || isNaN(MAX_CREATE)) {
    console.error('[!] Input tidak valid.');
    process.exit(1);
  }

  let index = 0;

  const runNextBatch = async () => {
    const batch = [];

    for (let i = 0; i < MAX_PARALLEL; i++, index++) {
      batch.push((async () => {
        try {
          await relogCokis(index);
        } catch (err) {
          console.error(`[!] Error reg : ${err.message}`);
        }
      })());
    }

    await Promise.allSettled(batch);
    await delay(5000); // optional delay antar batch
  };

  while (index < MAX_CREATE) {
    await runNextBatch();
  }

  console.log('\n REG done........!\n');
})();